use oficina_dio;
Drop table if exists Veiculos;

create table Veiculos (
	idVeiculo INT primary key,
	idCliente INT,
	VIN_code VARCHAR(50),
	Marca VARCHAR(50),
	Modelo VARCHAR(50),
	Ano VARCHAR(50)
);

# Incluindo as foreign keys
alter table Veiculos
ADD foreign key (idCliente) REFERENCES Clientes(idCliente);